# frozen_string_literal: true

describe 'solution' do
  # O(N ** 2)
  def basic_solution(a)
    a.map { |x| a.count { |ai| x % ai != 0 } }
  end

  # O(N * log(N)) or O(N ** 2)
  def better_solution(a)
    divisors = a.each_with_object({}) { |k, r| r[k] = 0 }
    n = a.max
    a.each do |d|
      d.step(n, d) do |k|
        next unless divisors.member?(k)
        divisors[k] += 1
      end
    end
    a.map { |x| a.size - divisors[x] }
  end

  # O(N * log(N))
  def solution(a)
    n = a.max
    sieve = a.each_with_object({}) { |x, r| r[x] = [1, x].uniq }
    a_count = a.each_with_object(Hash.new(0)) { |x, c| c[x] += 1 }

    i = 2
    while i * i <= n
      k = i * i
      while k <= n
        if sieve.member?(k)
          sieve[k] << i
          sieve[k] << k / i unless k == i * i
        end
        k += i
      end
      i += 1
    end

    a.map { |k| a.size - sieve[k].map { |d| a_count[d] }.reduce(:+) }
  end

